import styles from "../styles/Header.module.css";

function Header() {
    return (
        <header>
            <div className="name">
                <h1>LAN BORG</h1>
                <h3>UX LEAD DESIGNER & ENGINEER</h3>
            </div>

            <nav>
                <ul>
                    <li className="./portfolio">PORTFOLIO</li>
                    <li className="./about">ABOUT</li>
                    <li className="./contact">CONTACT</li>
                </ul>
            </nav>
            <hr className={styles.dotted2}></hr>
            <hr className={styles.dotted3}></hr>
        </header>
    );
}

export default Header;
